import React from 'react';

class BadgesList extends React.Component {
  render() {
    return (
      <div className='BadgesList__Badge-container'>
        <div className='BadgeList__BadgeImage-container'></div>
          <img className='BadgeList__BadgeImage'></img>
      </div>
    );
  };
}

export default BadgesList;
